import React from "react";
import { Typography, List, ListItem, ListItemText } from "@mui/material";

const RecipeSuggestions = ({ pantryItems }) => {
  console.log("Pantry items in RecipeSuggestions component:", pantryItems); // Debug log

  // Check if pantryItems is undefined or null
  if (!pantryItems || pantryItems.length === undefined) {
    return (
      <div>
        <Typography variant="h5">Recipe Suggestions</Typography>
        <Typography>No pantry items available for suggestions.</Typography>
      </div>
    );
  }

  return (
    <div>
      <Typography variant="h5">Recipe Suggestions</Typography>
      {pantryItems.length > 0 ? (
        <List>
          {pantryItems.map((item, index) => (
            <ListItem key={index}>
              <ListItemText primary={`Suggested recipe for: ${item}`} />
            </ListItem>
          ))}
        </List>
      ) : (
        <Typography>No recipe suggestions available.</Typography>
      )}
    </div>
  );
};

export default RecipeSuggestions;
